INSERT INTO `CustomComponent` (`id`, `controller`, `type`, `value`, `fk_id_layout`, `parent_id`) VALUES
	(1, NULL, 'div', '<div id="messageBanner">\n	<span id="info-icon" class="fa fa-info-circle"></span>\n	<custom-text id="headingTxt" custom-text-key="$parent.heading"></custom-text>\n	<custom-text id="message" custom-text-key="$parent.message"></custom-text>\n\n	<style>\n		span#info-icon {\n			position:absolute;\n			top:15px;\n			left:15px;\n			float:none;\n		}\n		@media all and (max-width: 480px) {\n			span#info-icon {\n				position: absolute;\n				font-size: 3em;\n				top: 1px;\n				left: 5px;\n				display: inline-block;\n			}\n		}\n		div#message-container.info {\n			background-color:#de3919;\n			font-family: Arial, standard;\n			font-size:12px;\n			color: #EAEAEA;\n		}\n		div#message-container.success {\n			background-color:#449D44;\n			font-family: Arial, standard;\n			font-size:12px;\n			color: #EAEAEA;\n		}\n		div#message-container.error {\n			background-color:#de3919;\n			font-family: Arial, standard;\n			font-size:12px;\n			color: #EAEAEA;\n		}\n		div#message-container.warn {\n			background-color:#EC971F;\n			font-family: Arial, standard;\n			font-size:12px;\n			color: #EAEAEA;\n		}\n		#headingTxt {\n			font-family: Arial,bold;\n			color: #FFFFFF;\n			font-size : 14px;\n            font-weight : bold;\n			width : 70%;\n			margin : auto;\n			display : block;\n			text-align:center;\n			padding:4px 1px 1px 1px;\n		}\n		#message {\n			font-family: Arial,regular;\n			color: #FFFFFF;\n            font-size:12px;\n			text-align:center;\n		}\n		span#message {\n			font-size:14px;\n		}\n		#message-container {\n			position:relative;\n		}\n		#optGblPage message-banner div#message-container {\n			width:100% ;\n			box-shadow: none ;\n			-webkit-box-shadow:none;\n			position: relative;\n		}\n		div.message-button {\n			padding-top: 0px;\n		}\n		div#message-content {\n			text-align: center;\n			background-color: inherit;\n			padding-bottom: 5px;\n		}\n        #return-button-row button {\n            border-radius: 30px\n        }\n        #close-button-row button {\n            border-radius: 30px\n        }\n	</style>\n</div>', 1, NULL),
	(2, NULL, 'div', '\n\n<style>\n	div#optGblPage {\n		font-family: "Helvetica Neue",Helvetica,Arial,sans-serif;\n		font-size:14px;\n	}\n	#optGblPage .warn {\n		background-color: #3399FF\n	}\n	#helpButton button {\n		font: 300 16px/20px "Helvetica Neue",Helvetica,Arial,sans-serif;\n		display:inline-block;\n		white-space: nowrap;\n		text-align: center;\n		height: 40px;\n		background: #fff;\n		color: #323232;\n		border: 1px solid rgba(0,0,0,.25);\n		min-width: 15rem;\n		border-radius: 20px;\n		font-size: 16px;\n		padding-left: 0px !important;\n	}\n	#cancelButton button {\n		font: 300 16px/20px "Helvetica Neue",Helvetica,Arial,sans-serif;\n        display: inline-block;\n        white-space: nowrap;\n        text-align: center;\n        height: 40px;\n        background: #4e4e4e;\n        color: #ffffff;\n        border: 1px solid #4e4e4e;\n        min-width: 15rem;\n        border-radius: 20px;\n        font-size: 16px;\n        padding-left: 0px !important;\n	}\n	#validateButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}\n	#cancelButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}\n	#helpButton button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}\n	#i18n > button:focus {outline:0;border-color: #ff6a10;outline: #6e6e6e 1px dotted;}\n	#cancelButton button:hover:enabled {\n		border-color: rgba(255,106,16,.75);\n	}\n	#cancelButton button:active {\n		background-image: linear-gradient(rgba(0,0,0,.05),rgba(0,0,0,.05));\n		border-color: rgba(0,0,0,.25) rgba(0,0,0,.2) rgba(0,0,0,.15);\n		box-shadow: none;\n		outline: 0px;\n	}\n	#cancelButton button custom-text {\n		vertical-align:8px;\n	}\n	#helpButton button:hover {\n		border-color: rgba(255,106,16,.75);\n	}\n	#helpButton button:active {\n		background-image: linear-gradient(rgba(0,0,0,.05),rgba(0,0,0,.05));\n		border-color: rgba(0,0,0,.25) rgba(0,0,0,.2) rgba(0,0,0,.15);\n		box-shadow: none;\n		outline: 0px;\n	}\n	#helpButton button custom-t