	('T', 1455, 'A757436', '2020-02-04 09:53:08', NULL, NULL, NULL, 'MASTERCARD_MOBILE_APP_FAILURE_PAGE_16', 'PUSHED_TO_CONFIG', 'fr', 16, 'FAILURE_PAGE', 'L\'activation a chou', NULL, NULL, NULL, 2, NULL, NULL, 9),
	('T', 1456, 'A757436', '2020-02-04 09:53:08', NULL, NULL, NULL, 'MASTERCARD_MOBILE_APP_FAILURE_PAGE_17', 'PUSHED_TO_CONFIG', 'fr', 17, 'FAILURE_PAGE', 'L\'authentification sur votre tlphone portable et donc l\'activation de paiement, ont chou. Le processus de paiement a t interrompu et votre carte n\'a pas t dbite. Si vous souhaitez continuer le processus d\'achat, veuillez recommencer la tentative de paiement.', NULL, NULL, NULL, 2, NULL, NULL, 9),
	('T', 1457, 'A757436', '2020-02-04 09:53:08', NULL, NULL, NULL, 'MASTERCARD_MOBILE_APP_FAILURE_PAGE_32', 'PUSHED_TO_CONFIG', 'fr', 32, 'FAILURE_PAGE', 'Paiement non effectu - Problme technique', NULL, NULL, NULL, 2, NULL, NULL, 9),
	('T', 1458, 'A757436', '2020-02-04 09:53:08', NULL, NULL, NULL, 'MASTERCARD_MOBILE_APP_FAILURE_PAGE_33', 'PUSHED_TO_CONFIG', 'fr', 33, 'FAILURE_PAGE', 'En raison dun problme technique, le paiement na pas pu tre effectu et votre carte na pas t dbite. Si vous souhaitez poursuivre lachat, nous vous prions de bien vouloir essayer  nouveau.', NULL, NULL, NULL, 2, NULL, NULL, 9),
